import React from "react";
import MaterialTable from 'material-table';

function Table() {
    const data = [ {name:"kamalesh",age:24},
    {name:"magesh",age:24},
    {name:"nandy",age:24},
    {name:"vinmeetha",age:24} ]
    const columns = [
        {
            name:"Name",field:"name"
        },
        {
            name:"Age",field:"age"
        }
    ]
    
    return (
      <>
        <h1>table goes here</h1>
        <MaterialTable title="Material Table"
        data={data}
        columns={columns}
        />
      </>
    );
  }
  
  export default Table;
